import React, { useState } from "react";
import Navbar from "../../components/Navbar";
import Footer from "../../components/Footer";
import FormFields from "./Form_Fields";
import { Link } from "react-router-dom";

const CreateCustomer = () => {
  const [writingDirection, setWritingDirection] = useState("ltr");
  const [message, setMessage] = useState("Hello World");
  return (
    <>
      <Navbar />
      <main className="p-[4rem]">
        <section className="p-[4rem] grid justify-center items-center" dir={writingDirection}>
          <div className="row">
            <Link to="/customers">
              <i className="fas fa-arrow-left"></i> Customers
            </Link>
          </div>
          <h1 className="title">New Customer</h1>
          <p className="message">{message}</p>
          <form action="/customers" method="POST" className="flex flex-col justify-center items-center w-[90vw]">
            <FormFields />
          </form>
        </section>
      </main>
      <Footer />
    </>
  );
};

export default CreateCustomer;
